import React from "react";

const oneFriendCard = (props) => {
    return (
        <div key={props.id} className="card col-md-2 m-4">
            {/* <img src={props.imgSrc} className="card-img-top" alt="..." /> */}
            <div className="card-body">
                <h5 className="card-title">{props.name}</h5>
                <strong>{props.manufacturer}</strong>
                <p className="card-text">{props.description}</p>
                <p style={{ color: "red" }}>{props.cost}</p>
                <div>
                    <button className="btn btn-danger m-1">Delete</button>
                    <span><button className="btn btn-info m-1">Edit</button></span>
                </div>
            </div>
        </div >
    )
}


export default React.memo(oneFriendCard);
